世界中に広まったYFEファミリーコミュニティーの日本人メンバーとの特別な結びつきで知られているYour Favorite Enemiesのメンバーは彼らの有名なYFE-TV Podcastの特別日本語版を配信することを決めた。単に日本の人々にYour Favorite Enemiesの本質を理解してもらうためだけでなく、バンド結成当初からの日本の人々の素晴らしいサポートに対し敬意を表すためである。
 &#x60;br&#x62; &#x60;br&#x62;
YFE-TVはYFEを構成する6人のアーティストのユニークで親しみやすいポートレートとして、そして約3年間彼らを支えてきたクレイジーでユニークなスタッフの紹介として、Your Favoite Enemiesの内部を知ることができるものとなっている。コンサート映像から彼らの積極的な人権に対する運動、インタビュー、スタジオでのセッションやツアーのレポートまで、YFE-TVは他のテレビ番組では見ることができないYour Favorite Enemiesを見ることができる。
 &#x60;br&#x62; &#x60;br&#x62;
日本語のYFE-TVの無料PodcastはYour Favorite Enemiesの独特な世界につながる素晴らしい方法である。また、ひげを生やしたヒーロー、口ひげを生やしたセレブとスーパーモデルがエゴと妄想のためにスクリーンを共有する、純粋で見せかけではないユーモアに溢れたエンターテイメントの天才の宝庫であることは間違いない。

안녕하세요?&#xD;
 &#xD;
Yonsei Internet Radio Broadcast, 줄여서 &amp;#039;엷&amp;#039; 입니다.&#xD;
 &#xD;
교정을 거닐며 접하게 되는 수많은 언론들.&#xD;
 &#xD;
하지만 무언가 공허한 목소리 같다는 생각 드신 적 없나요?&#xD;
 &#xD;
총장님이 무슨 말씀을 하셨고, 등록금이 어떻게 되고 있고...&#xD;
 &#xD;
너무나 중요한 문제들이긴 하지만,&#xD;
 &#xD;
당장 오늘 필요한건&#xD;
 &#xD;
후배들 밥 사주기 적당한 집이 어딘지,&#xD;
 &#xD;
점심 때 과방에서, 혹은 동방에서 시켜먹기 좋은 음식점이 어딘지,&#xD;
 &#xD;
시험기간에 파는 야식은 어떤 것인지 같은 것들이거나&#xD;
 &#xD;
아니면&#xD;
 &#xD;
시험 기간 단과대 독서실에서 책 두권 분량을 시험범위로 내준&#xD;
 &#xD;
야속한 교수님을 같이 원망할 수 있는 그런 친근한 친구 일테죠.&#xD;
 &#xD;
연세인의 삶을 아는,&#xD;
 &#xD;
그런 소소한 일들에 함께 기뻐하고 슬퍼할 줄 아는&#xD;
 &#xD;
그런 언론을 지향합니다.&#xD;
 &#xD;
당신의 느낌, 당신의 생각, 당신의 소리를 들려주세요.&#xD;
 &#xD;
지금 제 엷자리에서.

You Can't Eat the Sunshine is the podcast of Esotouric, the offbeat Los Angeles company that turns the notion of guided bus tours on its ear. Each week, join Kim Cooper and Richard Schave on their Southern California adventures, as they visit with fascinating characters for wide-ranging interviews that reveal the myths, contradictions, inspirations and passions of the place. There's never been a city quite like Los Angeles. Tune in if you'd like to find out why.&#xD;
&#xD;
